/**
 * @param {number[]} nums
 * @return {number}
 * @see https://leetcode.com/problems/largest-perimeter-triangle/
 */
var largestPerimeter = function (nums) {
  //console.log(nums.length)
  var isTriangle = (a, b, c) => {
    // 三角形の3辺の長さについて以下の定理が成り立つ。 三角形の2辺の長さの和は、他の1辺の長さより大きい。 三角形の2辺の長さの差は、他の1辺の長さより小さい。

    return (
      ((a + b > c) && ((a - b < c) || (b - a < c))) &&
      ((b + c > a) && ((b - c < a) || (c - b < a))) &&
      ((c + a > b) && ((c - a < b) || (a - c < b)))
    )
  }

  nums = nums.sort((num1, num2) => num2 - num1)

  for (var i = 0; i < nums.length; i++) {
    for (var j = i + 1; j < nums.length; j++) {
      for (var k = j + 1; k < nums.length; k++) {
        if (isTriangle(nums[i], nums[j], nums[k])) {
          let sum = nums[i] + nums[j] + nums[k]
          if (sum > 0) return sum
        }
      }
    }
  }
  return 0;

}

